import React from 'react'

export default function Home() {
  return (
    <div className='HomePage'>
      <div className='container'>
        <h2>Listen to Qraun Kareem with your popluar sound </h2>
        <p>
            Our playlist contains all quran saruhs with all popluar readers 
        </p>
      </div>
    </div>
  )
}
